import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import RescompanyListScreen from './RescompanyListScreen';
import RescompanyDetailsScreen from './RescompanyDetailsScreen';

const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="RescompanyList" component={RescompanyListScreen} />
        <Stack.Screen name="RescompanyDetails" component={RescompanyDetailsScreen} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
export default App;
